import React from 'react'
import Card from 'react-bootstrap/Card'

function Cards({food}) {
  return (
   <>
    {food.map((item,k)=>{
    return(
      <>
     
            <Card style={{ width: '22rem', border:"none" }}>
      <Card.Img variant="top" src={item.imgdata} className='cardimg' />
      <Card.Body>
        {/* <Card.Title>Card Title</Card.Title> */}
        {/* <Card.Text>
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </Card.Text> */}
        {/* <Button variant="primary">Go somewhere</Button> */}
        <div className="uppertext">
            <p className="restaurant">{}</p>
            <p className="rating">3.8✩</p>
        </div>
        <div className="middletext">
            <p className="cuisine">North Indian,Biriyani,Mughlai</p>
            <p className="cost">₹350 for one</p>
        </div>

        <div className="line"></div>

      </Card.Body>
    </Card>

         
      </>
    )
      })}
   </>
  )
}

export default Cards
